import React, { useState } from 'react';
import Welcome from './Welcome';
import Accueil from './Accueil';

function App() {
  const [showAccueil, setShowAccueil] = useState(false);

  return (
    <>
      {!showAccueil ? (
        <Welcome onEnter={() => setShowAccueil(true)} />
      ) : (
        <Accueil />
      )}
    </>
  );
}

export default App;
